import React, { useState, useEffect } from 'react';
import { useNavigate, useParams } from "react-router-dom";


const ViewBooking = () => {

    const navigate = useNavigate();
    const auth = localStorage.getItem('user');
    const params = useParams();
    const [bookingDetail, setbookingDetail] = useState([]);
    const [bookingItems, setbookingItems] = useState([]);
    const [qty, setQty] = useState("");
    const [address, setAddress] = useState("")
    const [name, setName] = useState("")
    const [phone, setPhone] = useState("")
    // const [message, showMessage] = useState("");
    useEffect(() => {
        if (!(auth)) {
            navigate('/login');
        }

        const fetchMyBookingDetails = async () => {
            try {
                const response = await fetch(`http://localhost:5000/api/booking/${params.id}`, {
                    method: 'get',
                    headers: {
                        'Content-Type': 'application/json',
                        Authorization: `Bearer ${JSON.parse(auth).token}`,
                    }
                });
                const data = await response.json();
                setbookingDetail(data);
                setAddress(data.shippingAddress);
                setbookingItems(data.bookingItems);
                setName(data.shippingAddress.name)
                setPhone(data.shippingAddress.phone)
                setQty(data.bookingItems.qty)
                // console.log(data);

            } catch (error) {
                console.error("Error fetching vehicles:", error);
            }
        };

        fetchMyBookingDetails();
    }, [navigate, auth, params.id])
    console.log(bookingDetail);
    console.warn(address, bookingItems, name, phone, qty);
    // console.warn(params.id);

    // const getImageUrl = (imageName) => {
    //     return `http://localhost:5000${imageName}`;
    // };
    return (
        <div className="inline-grid mt-20 w-full">
            <div className=" mt-4">
                <h1 className='text-center font-extrabold text-2xl text-stone-600 '>View Booking Details</h1>
            </div>
            <div className="flex ">


                <div className="w-4/12 bg-slate-500 ">
                    <p> This is  image</p>
                </div>
                <div className="w-4/12 bg-red-500  ">
                    <p> this Rent Bill Details</p>

                </div>
                <div className="w-4/12  bg-slate-600 ">
                    <p> this is Address </p>


                </div>
            </div>
        </div>

    )
}



export default ViewBooking;
